window.bookSummaryJSON = "<p>Over the years, Connor has pieced together evidence of a mysterious group of aliens who roamed the multiverse and have been to New Earth.</p> <p>Setting off to make new discoveries about them is straightforward enough, but this is New Earth, and Connor Gates has a knack for finding trouble.</p> <p>For over 20 years, Connor and Diaz have been friends. They’ve survived two wars and have seen the best and the worst of each other. When a terrorist attack takes the life of Diaz’s son, their friendship will be pushed to the breaking point.</p> <p>To find who is responsible, Diaz is willing to cross as many lines as it takes. Connor will do everything he can to protect his friend, even from himself. It’ll take everything he’s got to find who is responsible while preserving a peaceful coexistence with New Earth’s inhabitants.</p> <p>Sometimes protecting your friends is a lot tougher than fighting your enemies.</p> <p><b><i>Impulse</i></b><b> is the 12th book in the best-selling military science fiction series, First Colony. Listen to the 12th book in this sprawling space opera today!</b></p> <p><b>First Colony Series</b></p> <p><i>Book 1 - Genesis</i></p> <p><i>Book 2 - Nemesis</i></p> <p><i>Book 3 - Legacy</i></p> <p><i>Book 4 - Sanctuary</i></p> <p><i>Book 5 - Discovery</i></p> <p><i>Book 6 - Emergence</i></p> <p><i>Book 7 - Vigilance</i></p> <p><i>Book 8 - Fracture</i></p> <p><i>Book 9 - Harbinger</i></p> <p><i>Book 10 - Insurgent</i></p> <p><i>Book 11 - Invasion</i></p> <p><i>Book 12 - Impulse</i></p>"; 
